import './login.scss';
import React from "react";

const Login = () => {
  return (
    <div className='login'>
      <div className="top">
        <div className="wrapper">
          <img
            className='logo' 
            src="https://upload.wikimedia.org/wikipedia/commons/0/08/Netflix_2015_logo.svg" 
            alt="Netflix logo" />
        </div>
        <div className="container">
          <form action="">
            <h1>Sign In</h1>
          </form>
        </div>
      </div>
    </div>
  )
}

export default Login;
